import React from 'react';

import * as S from './styles'

interface ShowMoreProps {
  url: string
}

const ShowMoreSeparator: React.FC<ShowMoreProps> = ({ url }) => {

  return (
    <S.Container>
      <S.SeeMore>
        <span>Veja mais</span>
        <S.Triangle />
      </S.SeeMore>
    </S.Container>
  )
}

export default ShowMoreSeparator;
